import React from 'react';
import './App.css';
import Nav from './components/Nav';
import Home from './components/Home/Home';
import Contact from './components/Contact/Contact';
import ContactList from './components/ContactList/ContactList';
import ContactAdminEdit from './components/ContactAdminEdit/ContactAdminEdit';
import About from './components/About/About';
import Blog from './components/Blog/Blog'; 
import BlogAdminList from './components/BlogAdminList/BlogAdminList'; 
import BlogAdminAdd from './components/BlogAdminAdd/BlogAdminAdd'; 
import BlogAdminEdit from './components/BlogAdminEdit/BlogAdminEdit'; 
import Login from './components/Login/Login'
import Admin from './components/Admin/Admin';
import {BrowserRouter as Router, Switch, Route} from 'react-router-dom';
import Footer from './components/Footer';

function App() {
  return (
    <Router>
      <div className="App">
        <Nav />
          <Switch>
              <Route path="/" exact component={Home} />
              <Route path="/about" component={About} />
              <Route path="/blog" component={Blog} />
              <Route path="/contact" component={Contact} />
              <Route path="/login" component={Login} />
              <Route path="/admin" component={Admin} />
              <Route path="/contact_list" component={ContactList} />
              <Route path="/contact_list_edit" component={ContactAdminEdit} />
              <Route path="/blog_list" component={BlogAdminList} />
              <Route path="/blog_list_add" component={BlogAdminAdd} />
              <Route path="/blog_list_edit" component={BlogAdminEdit} />
          </Switch>
          <Footer />
        </div>
    </Router>
  );
}



export default App;
